{
    "extends": "eslint:recommended",
    "parserOptions": {
        "ecmaVersion": 6,
        "sourceType": "module",
        "ecmaFeatures": {
            "impliedStrict": true
        }
    },
    "env": {
        "es6": true,
        "worker": true,
        "node": true,
        "browser": true
    },
    "rules": {
        "keyword-spacing": [2, {
            "overrides": {
                "if": {"after": true},
                "for": {"after": true},
                "while": {"after": true},
                "switch": {"after": true},
                "catch": {"after": true}
            }
        }],
        "key-spacing": [2, {"beforeColon": false, "afterColon": true, "mode": "strict"}],
        "arrow-spacing": 2,
        "comma-spacing": 2,
        "comma-style": 2,
        "indent": [2, 4, {"SwitchCase": 1}],
        "no-var": 2,
        "no-bitwise": 0,
        "no-alert": 2,
        "no-console": 0,
        "no-debugger": 1,
        "no-unused-vars": 0,
        "no-mixed-spaces-and-tabs": 2,
        "quotes": [2, "single", "avoid-escape"],
        "semi": 2,
        "semi-spacing": 2,
        "space-before-blocks": 2,
        "space-before-function-paren": [2, {"anonymous": "always", "named": "never"}],
        "space-in-parens": [2, "never"],
        "space-infix-ops": 2
    }
}

